The Mystery of Water

Science Documentary hosted by Melanie Preston, published by Oasis HD in 2008 - English narration


Information
------------------------------

Water -- just a liquid or much more? Many researchers are convinced that water is capable of &quot;memory&quot; by storing information and retrieving it. The possible applications are innumerable: limitless retention and storage capacity and the key to discovering the origins of life on our planet. Research into water is just beginning.

